import React, {Component} from 'react';



class App extends Component {
 state= {
   items : [{ itemName: 'Kuba', complete: 'yes' },
            { itemName: 'Klaudusia', complete: 'yes' },]
   }



 render() {
  return (
 <div>
   <AddItem  add={this.addFuncion}/>
   <ToDos items={this.state.items}/>


 </div>
  );
}





}


export default App;
